    /**
     * Check whether mime-type is supported
     *
     * @param string $mime
     *
     * @return bool
     */
    public static function isSupported(string $mime) :bool {
        $delimPos = strpos($mime, "/");
        if (!$delimPos) {
            return false;
        }
        $group = substr($mime, 0, $delimPos);
        $type  = substr($mime, $delimPos + 1);

        return isset(self::$mimes[$group]) && isset(self::$mimes[$group][$type]);
    }

    /**
     * Return the mime-type information.
     *
     * @param string $mime
     *
     * @return array MimeInfo {
     * @var boolean  $compressible Whether a file of this type can be gzipped.
     * @var string[] $extensions   Known extensions associated with this mime type.
     * @var string   $source       Where the mime type is defined. If not set, it's probably a custom media type.
     * @var string   $charset      The default charset associated with this type, if any.
     * } | null
     */
    public static function getInfo(string $mime) :?array {
        $delimPos = strpos($mime, "/");
        if (!$delimPos) {
            return null;
        }
        $group = substr($mime, 0, $delimPos);
        $type  = substr($mime, $delimPos + 1);

        if (empty(self::$mimes[$group])) {
            return null;
        }

        return self::$mimes[$group][$type] ?? null;
    }

    /**
     * Return the plain list of supported mime-types
     *
     * @param string $group Mime group - the one going before the slash
     *
     * @return string[]
     */
    public static function getSupportedMimes(string $group = null) :array {
        $result = [];

        if ($group === null) {
            foreach (self::$mimes as $group => $mimes) {
                foreach ($mimes as $type => $data) {
                    $result[] = $group . "/" . $type;
                }
            }
        }
        else if (isset(self::$mimes[$group])) {
            foreach (self::$mimes[$group] as $type => $data) {
                $result[] = $group . "/" . $type;
            }
        }

        return $result;
    }

    /**
     * Check whether file extension is supported
     *
     * @param string $extension
     *
     * @return bool
     */
    public static function isSupportedExtension(string $extension) :bool {
        return (bool)(self::$extensions[$extension] ?? false);
    }

    /**
     * Return known relative mime-types.<br/>
     * <b>NOTE: there can be more than one mime-type </b>
     *
     * @param string $extension
     *
     * @return array|null
     */
    public static function getExtensionMimes(string $extension) :?array {
        return self::$extensions[$extension] ?? null;
    }

    /**
     * Return the plain list of supported file extensions.
     *
     * @return string[]
     */
    public static function getSupportedExtensions() :array {
        return \array_keys(self::$extensions);
    }
